export default class Item extends Component {

  render() {
    return (
    <div>
         <li>
            <lable>
                <input id="toggle" className="toggle" type="checkbox"/>
                <label htmlFor="toggle">xxxx</label>
            </lable>
                <button className='destroy'></button>
         </li>
    </div>
    )
  }
}
